"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Bone cancer (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/bone-cancer-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H5325141\">",
"      <span class=\"h1\">",
"       What is bone cancer?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Bone cancer happens when normal cells in the bone change into abnormal cells and grow out of control. This article discusses cancer that starts in the bone. But people can also get cancer in their bones after cancer from another part of the body spreads to the bones.",
"     </p>",
"     <p>",
"      There are different types of bone cancer, depending on the cells involved. The most common type is osteosarcoma. Other common types of bone cancer are chondrosarcoma and Ewing sarcoma.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5325156\">",
"      <span class=\"h1\">",
"       What are the symptoms of bone cancer?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Bone cancer usually causes pain and swelling in the area of the cancer. The pain can come and go, but it usually gets worse over weeks to months. The pain is sometimes worse at night and with exercise. Some people with bone cancer might also see or feel a lump on their bone or in the tissues around the bone.",
"     </p>",
"     <p>",
"      All of these symptoms can also be caused by conditions that are not bone cancer. But if you have these symptoms, tell your doctor or nurse.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5325171\">",
"      <span class=\"h1\">",
"       Is there a test for bone cancer?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor or nurse will first order an X-ray of your bone.",
"     </p>",
"     <p>",
"      If the X-ray shows that you likely have bone cancer, you will have other tests. These will probably include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blood tests",
"       </li>",
"       <li>",
"        An imaging test, such as an MRI or CT scan, of the area with the cancer &ndash; An imaging test creates pictures of the inside of the body.",
"       </li>",
"       <li>",
"        A full-body bone scan or other imaging test, to check for bone cancer in other parts of your body",
"       </li>",
"       <li>",
"        A biopsy &ndash; This is a procedure in which a doctor removes a sample of the cancer. Then another doctor looks at the sample under a microscope.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5325186\">",
"      <span class=\"h1\">",
"       What is cancer staging?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Cancer staging is a way in which doctors find out if a cancer has spread past the layer of tissue where it began, and, if so, how far.",
"     </p>",
"     <p>",
"      The right treatment for you will depend a lot on the type of bone cancer you have, its stage, and your other medical problems.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5325201\">",
"      <span class=\"h1\">",
"       How is bone cancer treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Depending on the type of bone cancer, treatment includes 1 or more of the following:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Surgery &ndash; In general, surgery is the main treatment for bone cancer. The type of surgery you have depends on where your cancer is and how big it is. In most cases, surgeons do &ldquo;limb-sparing&rdquo; surgery. This is when the surgeon removes the cancer without removing the arm or leg where the cancer is growing. Depending on the type of surgery, the doctor might need to &ldquo;rebuild&rdquo; part of a bone after surgery.",
"        <br/>",
"        <br/>",
"        Sometimes, when bone cancer is growing in an arm or leg, surgery involves amputation. This is when the surgeon removes the arm or leg along with the cancer. After an amputation, some people use a prosthesis, which is a man-made arm or leg.",
"       </li>",
"       <li>",
"        Chemotherapy &ndash; Chemotherapy is the term doctors use to describe a group of medicines that kill cancer cells. Most people with bone cancer have chemotherapy before and after their surgery.",
"       </li>",
"       <li>",
"        Radiation therapy &ndash; Radiation kills cancer cells. Doctors might use radiation when people can&rsquo;t have surgery or when all of the cancer can&rsquo;t be removed safely with surgery.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5325216\">",
"      <span class=\"h1\">",
"       What happens after treatment?",
"      </span>",
"      &nbsp;&mdash;&nbsp;After treatment, your doctor will check you every so often to see if the cancer comes back. Follow-up tests can include exams, blood tests, chest X-rays, and imaging tests.",
"     </p>",
"     <p>",
"      You should also watch for the symptoms listed above. Having those symptoms could mean your bone cancer has come back. Tell your doctor or nurse if you have any symptoms.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5325231\">",
"      <span class=\"h1\">",
"       What happens if my bone cancer comes back or spreads?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If your bone cancer comes back or spreads, you might have more surgery, radiation, or chemotherapy.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5325246\">",
"      <span class=\"h1\">",
"       What else should I do?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It&rsquo;s important to follow all of your doctor&rsquo;s instructions about visits and tests. It&rsquo;s also important to talk to your doctor about any side effects or problems you have during treatment.",
"     </p>",
"     <p>",
"      Getting treated for bone cancer involves making many choices, such as what treatment to have. Always let your doctors and nurses know how you feel about a treatment. Any time you are offered a treatment, ask:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        What are the benefits of this treatment? Is it likely to help me live longer? Will it reduce or prevent symptoms?",
"       </li>",
"       <li>",
"        What are the downsides to this treatment?",
"       </li>",
"       <li>",
"        Are there other options besides this treatment?",
"       </li>",
"       <li>",
"        What happens if I do not have this treatment?",
"       </li>",
"      </ul>",
"     </p>",
