var script_f32_63_33787=[""].join("\n");
var outline_f32_63_33787=null;
var title_f32_63_33788="Indications for GBS intrapartum antibiotic prophylaxis";
var content_f32_63_33788=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F66582&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F66582&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Indications and nonindications for intrapartum antibiotic prophylaxis to prevent early-onset group B streptococcal (GBS) disease",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Intrapartum GBS prophylaxis indicated",
"       </td>",
"       <td class=\"subtitle1\">",
"        Intrapartum GBS prophylaxis not indicated",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Previous infant with invasive GBS disease",
"       </td>",
"       <td>",
"        Colonization with GBS during a previous pregnancy (unless an indication for GBS prophylaxis is present for current pregnancy)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        GBS bacteriuria during any trimester of the current pregnancy*",
"       </td>",
"       <td>",
"        GBS bacteriuria during previous pregnancy (unless an indication for GBS prophylaxis is present for current pregnancy)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Positive GBS vaginal-rectal screening culture in late gestation",
"        <sup>",
"         &Delta;",
"        </sup>",
"        during current pregnancy*",
"       </td>",
"       <td>",
"        Negative vaginal and rectal GBS screening culture in late gestation&Delta; during the current pregnancy, regardless of intrapartum risk factors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Unknown GBS status at the onset of labor (culture not done, incomplete, or results unknown) and any of the following:",
"        <ul>",
"         <li>",
"          Delivery at &lt;37 weeks' gestation&loz;",
"         </li>",
"         <li>",
"          Amniotic membrane rupture &ge;18 hours",
"         </li>",
"         <li>",
"          Intrapartum temperature &ge;100.4&deg;F (&ge;38.0&deg;C)",
"          <sup>",
"           &sect;",
"          </sup>",
"         </li>",
"         <li>",
"          Intrapartum NAAT",
"          <sup>",
"           ",
"          </sup>",
"          positive for GBS",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        Cesarean delivery performed before onset of labor on a woman with intact amniotic membranes, regardless of GBS colonization status or gestational age",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     NAAT: nucleic acid amplification tests.",
"     <br>",
"      * Intrapartum antibiotic prophylaxis is not indicated in this circumstance if a cesarean delivery is performed before onset of labor on a woman with intact amniotic membranes.",
"      <br>",
"       &Delta; Optimal timing for prenatal GBS screening is at 35 to 37 weeks' gestation.",
"       <br>",
"        <font class=\"lozenge\">",
"         &loz;",
"        </font>",
"        Recommendations for the use of intrapartum antibiotics for prevention of early-onset GBS disease in the setting of threatened preterm delivery are discussed separately.",
"        <br>",
"         &sect; If amnionitis is suspected, broad-spectrum antibiotic therapy that includes an agent known to be active against GBS should replace GBS prophylaxis.",
"         <br>",
"          &Dagger; NAAT testing for GBS is optional and might not be available in all settings. If intrapartum NAAT is negative for GBS but any other intrapartum risk factor (delivery at &lt;37 weeks' gestation, amniotic membrane rupture at &ge;18 hours, or temperature &ge;100.4&deg;F [&ge;8.0&deg;C]) is present, then intrapartum antibiotic prophylaxis is indicated.",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Verani JR, McGee L, Schrag SJ, Division of Bacterial Diseases, National Center for Immunization and Respiratory Diseases, Centers for Disease Control and Prevention (CDC). Prevention of perinatal group B streptococcal disease - revised guidelines from CDC, 2010. MMWR Recomm Rep 2010; 59:1.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
