var script_f32_63_33789=[""].join("\n");
var outline_f32_63_33789=null;
var title_f32_63_33790="Treatment of uncomplicated malaria";
var content_f32_63_33790=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F72019&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F72019&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Guidelines for treatment of uncomplicated P. falciparum malaria (or species not identified)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_left\">",
"       Recommended drug and adult dose",
"      </td>",
"      <td class=\"subtitle1_left\">",
"       <p>",
"        Recommended drug and pediatric dose",
"       </p>",
"       <p>",
"        (pediatric dose should NEVER exceed adult dose)",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       Chloroquine-resistant or unknown resistance*",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" colspan=\"2\">",
"       All malarious regions except those specified as chloroquine-sensitive listed below. Middle Eastern countries with chloroquine-resistant",
"       <em>",
"        P. falciparum",
"       </em>",
"       include Iran, Oman, Saudi Arabia, and Yemen.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle3_left\" colspan=\"2\">",
"       A. Artemisinin combination therapy",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\" colspan=\"2\">",
"       <p>",
"        <strong>",
"         Artemether + lumefantrine (Coartem)",
"        </strong>",
"        &bull;",
"       </p>",
"       <p>",
"        Administration consists of combination tablets (1 tablet = 20 mg artemether and 120 mg lumefantrine). A 3 day treatment schedule with a total of 6 oral doses is recommended based on weight (5 - &lt;15 kg: 1 tablet per dose, 15 - &lt;25 kg: 2 tablets per dose, 25 - &lt;35 kg: 3 tablets per dose, &ge;35 kg: 4 tablets per dose). The patient should receive the initial dose, followed by the second dose 8 hours later, then 1 dose po bid for the following 2 days.",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\" colspan=\"2\">",
"       <p>",
"        <strong>",
"         Artesunate + amodiaquine",
"        </strong>",
"       </p>",
"       <p>",
"        Administration consists of separate scored tablets containing 50 mg of artesunate and 153 mg base of amodiaquine. The recommended treatment is 4 mg/kg of artesunate and 10 mg/kg of amodiaquine given once a day for 3 days.",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\" colspan=\"2\">",
"       <p>",
"        <strong>",
"         Artesunate + mefloquine",
"        </strong>",
"       </p>",
"       <p>",
"        Administration consists of separate scored tablets containing 50 mg of artesunate and 250 mg base of mefloquine, The recommended treatment is 4 mg/kg of artesunate given once a day for 3 days and 25 mg base/kg of mefloquine (usually split over 2 or 3 days to reduce vomiting and optimize absorption). This may be achieved either as 15 mg/kg (usually on the second day) followed by 10 mg/kg one day later, or as 8.3 mg/kg per day for 3 days.",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\" colspan=\"2\">",
"       <p>",
"        <strong>",
"         Artesunate + sulfadoxine-pyrimethamine",
"        </strong>",
"       </p>",
"       <p>",
"        Administration consists of separate scored tablets containing 50 mg of artesunate, and tablets containing 500 mg of sulfadoxine with 25 mg of pyrimethamine. The total recommended treatment is 4 mg/kg of artesunate given once a day for 3 days and a single administration of sulfadoxine-pyrimethamine (25/1.25mg base/kg) on day 1.",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle3_left\">",
"       B. Atovaquone-proguanil (Malarone)&bull;",
"      </td>",
"      <td class=\"subtitle3_left\">",
"       B. Atovaquone-proguanil (Malarone)&bull;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\" rowspan=\"2\">",
"       <p>",
"        Adult tab = 250 mg atovaquone/100 mg proguanil",
"       </p>",
"       <p>",
"        4 adult tabs po once daily x 3 days",
"       </p>",
"      </td>",
"      <td class=\"sublist2\">",
"       Adult tab = 250 mg atovaquone/100 mg proguanil",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       <p>",
"        Peds tab = 62.5 mg atovaquone/25 mg proguanil",
"       </p>",
"       <p>",
"        5-8 kg: 2 peds tabs po once daily x 3 days",
"       </p>",
"       <p>",
"        9-10 kg: 3 peds tabs po once daily x 3 days",
"       </p>",
"       <p>",
"        11-20 kg: 1 adult tab po once daily x 3 days",
"       </p>",
"       <p>",
"        21-30 kg: 2 adult tabs po once daily x 3 days",
"       </p>",
"       <p>",
"        31-40 kg: 3 adult tabs po once daily x 3 days",
"       </p>",
"       <p>",
"        &gt;40 kg: 4 adult tabs po once daily x 3 days",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle3_left\">",
"       C. Quinine sulfate",
"       <strong>",
"        PLUS",
"       </strong>",
"       one of the following: Doxycycline, Tetracycline, or Clindamycin",
"      </td>",
"      <td class=\"subtitle3_left\">",
"       C. Quinine sulfate&Delta;",
"       <strong>",
"        PLUS",
"       </strong>",
"       one of the following: Doxycycline&loz;, Tetracycline&loz;, or Clindamycin",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       Quinine sulfate: 542 mg base (=650 mg salt)&Delta; po tid x 3 or 7 days &sect;",
"      </td>",
"      <td class=\"sublist2\">",
"       Quinine sulfate: 8.3 mg base/kg (=10 mg salt/kg) po tid x 3 or 7 days &sect;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist3\">",
"       <strong>",
"        PLUS",
"       </strong>",
"       one of the following:",
"      </td>",
"      <td class=\"sublist3\">",
"       <strong>",
"        PLUS",
"       </strong>",
"       one of the following:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       Doxycycline: 100 mg po bid x 7 days",
"      </td>",
"      <td class=\"sublist2\">",
"       Doxycycline: 2.2 mg/kg po every 12 hours x 7 days",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       Tetracycline: 250 mg po four times daily x 7 days",
"      </td>",
"      <td class=\"sublist2\">",
"       Tetracycline: 6.25 mg/kg po every 6 hours x 7 days",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       Clindamycin: 20 mg base/kg/day (up to 1.8 grams) po divided tid x 7 days",
"      </td>",
"      <td class=\"sublist2\">",
"       Clindamycin: 6.7 mg base /kg  po every 8 hours x 7 days",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       Sulfadoxine-pyrimethamine: single dose of 25/1.25 mg base/kg on day 1.",
"      </td>",
"      <td class=\"sublist2\">",
"       Sulfadoxine-pyrimethamine: single dose of 25/1.25 mg base/kg on day 1.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle3_left\" colspan=\"2\">",
"       D. Mefloquine (Lariam and generics) &yen;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\" colspan=\"2\">",
"       <strong>",
"        Mefloquine + artesunate",
"       </strong>",
"       (dosing as above)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\" colspan=\"2\">",
"       <strong>",
"        Mefloquine +/- doxycycline",
"       </strong>",
"       &Dagger;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       Mefloquine: 684 mg base (=750 mg salt) po as initial dose, followed by 456 mg base (=500 mg salt) po given 6-12 hours after initial dose. Total dose = 1250 mg salt.",
"      </td>",
"      <td class=\"sublist2\">",
"       Mefloquine: 13.7 mg base/kg (=15 mg salt/kg) po as initial dose, followed by 9.1 mg base/kg (=10 mg salt/kg) po given 6-12 hours after initial dose. Total dose = 25 mg salt/kg.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist3\">",
"       <strong>",
"        PLUS",
"       </strong>",
"      </td>",
"      <td class=\"sublist3\">",
"       <strong>",
"        PLUS",
"       </strong>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       Doxycycline: 100 mg po bid",
"      </td>",
"      <td class=\"sublist2\">",
"       Doxycycline: 2.2 mg/kg po every 12 hours",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       Chloroquine-sensitive",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" colspan=\"2\">",
"       Central America west of Panama Canal; Haiti; the Dominican Republic; and most of the Middle East. Infections acquired in Korea and the states of the former Soviet Union have been uniformly caused by",
"       <em>",
"        P. vivax",
"       </em>",
"       to date and should therefore be treated as chloroquine-sensitive infections.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle3_left\">",
"       Chloroquine (Aralen and generics)",
"      </td>",
"      <td class=\"subtitle3_left\">",
"       Chloroquine (Aralen and generics)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       600 mg base (=1000 mg salt) po immediately, followed by 300 mg base (=500 mg salt) po at 6, 24, and 48 hours. Total dose: 1500 mg base (=2500 mg salt).",
"      </td>",
"      <td class=\"sublist2\">",
"       10 mg base/kg po immediately, followed by 5 mg base/kg po at 6, 24, and 48 hours. Total dose: 25 mg base/kg.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist3\">",
"       <strong>",
"        OR",
"       </strong>",
"      </td>",
"      <td class=\"sublist3\">",
"       <strong>",
"        OR",
"       </strong>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle3_left\">",
"       Hydroxychloroquine (Plaquenil and generics)",
"      </td>",
"      <td class=\"subtitle3_left\">",
"       Hydroxychloroquine (Plaquenil and generics)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist2\">",
"       620 mg base (=800 mg salt) po immediately, followed by 310 mg base (=400 mg salt) po at 6, 24, and 48 hours. Total dose: 1550 mg base (=2000 mg salt).",
"      </td>",
"      <td class=\"sublist2\">",
"       10 mg base/kg po immediately, followed by 5 mg base/kg po at 6, 24, and 48 hours. Total dose: 25 mg base/kg.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     po: orally; bid: twice daily; tid: three times daily.",
"     <br>",
"      * NOTE: There are 4 options (A, B, C, or D) available for treatment of uncomplicated malaria caused by chloroquine-resistant P. falciparum. The US Centers for Disease Control (CDC) recommends options A (artemether-lumefantrine), B, and C equally. The World Health Organization (WHO) recommends option A as the first line treatment for uncomplicated malaria. For option C, because there is more data on the efficacy of quinine in combination with doxycycline or tetracycline, these treatment combinations are generally preferred to quinine in combination with clindamycin. In addition, option C has higher incidence of adverse effects than options A or B. Because of a higher rate of severe neuropsychiatric reactions seen at treatment doses, option D (mefloquine) is recommended only when the other options cannot be used.",
"      <br>",
"       &bull; Take with food or whole milk. If patient vomits within 30 minutes of taking a dose, then they should repeat the dose. It is also acceptable to take one half of the dose twice daily.",
"       <br>",
"        &Delta; US manufactured quinine sulfate capsule is only available in a 324 mg (salt) strength; therefore 2 capsules should be sufficient for adult dosing. Pediatric dosing may be difficult due to unavailability of non-capsule forms of quinine in the United States.",
"        <br>",
"         &loz; Doxycycline and tetracycline are not indicated for use in children less than 8 years old. For children less than 8 years old with chloroquine-resistant",
"         <em>",
"          P. falciparum",
"         </em>",
"         , atovaquone-proguanil and artemether-lumefantrine are recommended treatment options; mefloquine can be considered if no other options are available. For children less than 8 years old with chloroquine-resistant",
"         <em>",
"          P. vivax",
"         </em>",
"         , mefloquine is the recommended treatment. If it is not available or is not being tolerated and if the treatment benefits outweigh the risks, atovaquone-proguanil or artemether-lumefantrine should be used instead.",
"         <br>",
"          &sect; For infections acquired in Southeast Asia, quinine treatment should continue for 7 days. For infections acquired elsewhere, quinine treatment should continue for 3 days.",
"          <br>",
"           &yen; Treatment with mefloquine is not recommended in persons who have acquired infections from Southeast Asia due to drug resistance.",
"           <br>",
"            &Dagger; Treatment with mefloquine as a single agent is acceptable in low endemic areas as the likelihood of spread and maintenance of drug resistant parasites is low. However, in highly endemic areas combination therapy is important to prevent emergence of resistance.",
"           </br>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from United States Centers for Disease Control guidelines for treatment of malaria: file://www.cdc.gov/malaria/pdf/treatmenttable.pdf (Accessed June 18, 2009). CDC Malaria Hotline: (770) 488-7788 Monday-Friday 8 am to 4:30 pm EST - (770) 488-7100 after hours, weekends and holiday.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
